import React from 'react'
import {Card} from 'react-bootstrap'

export default function Register(){
    return(
        <Card>
            <Card.Img variant="top" src="holder.js/100px180" />
            <Card.Body>
                <Card.Title>Registration Info</Card.Title>
            </Card.Body>
        </Card>
    );
}
